import React from "react";
import { Field, reduxForm } from 'redux-form'
import {Input} from "../../utils/helpers/formControls";
import {email, required, password} from "../../utils/helpers/validators";

const RegisterForm = () => {
    const handleSubmit = (data) => {
        console.log(12, data)
    }

    return (
        <form className="login-form" onSubmit={handleSubmit}>
            <div>
                <Field placeholder={'login'} name={"login"} component={Input}
                       validate={ [email, required] }/>
            </div>
            <div>
                <Field placeholder={'password'} name={"password"} component={Input}
                       validate={[password, required]}
                       type="password"/>
            </div>
            <div>
                <button>Submit</button>
            </div>
        </form>
    );
};
const RegisterReduxForm = reduxForm ({ form: 'login-form'})(RegisterForm)

const Register = () => {

    const onSubmit = (formData) => {
        console.log(12, formData)
    }
    return (
        <div className="root-ParticipantRegister">
            <RegisterReduxForm onSubmit={onSubmit}/>
        </div>
    );
};

export default Register;
